import React from 'react';
import BookYourSeat from './BookYourSeat';

export default function CompanyLogo() {
  // Replace these with your actual logo URLs.
  const logos = [
    "data:image/png;base64,",
    // "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/jpeg;base64,",
    "data:image/png;base64,"
];

  // Duplicate the logos array to create a seamless loop.
  const logoList = [...logos, ...logos];

  return (
    <div className="overflow-hidden">
      <div className="flex animate-marquee space-x-8">
        {logoList.map((logo, index) => (
          <img
            key={index}
            src={logo}
            alt="Company Logo"
            className="w-40 object-contain"
          />
        ))}
      </div>
      <BookYourSeat/>
      {/* Custom keyframes for the marquee animation.  
          In production, consider adding these to your Tailwind config under `extend`. */}
      <style>{`
        @keyframes marquee {
          0%   { transform: translateX(0%); }
          100% { transform: translateX(-50%); }
        }
        .animate-marquee {
          animation: marquee 30s linear infinite;
        }
      `}</style>
    </div>
  );
}
